create table project.dim_transactions(
	trans_id varchar(100) not null,
	date timestamp not null,
	card varchar(50) not null,
	oper_type varchar(50) not null,
	amount numeric not null,
	oper_result varchar(50) not null,
	terminal varchar(50) not null,
	up_time timestamp default current_timestamp
	) distributed by (trans_id);

create table project.dim_terminals(
	terminal varchar(50)  primary key,
	terminal_type varchar(5) not null,
	terminal_city varchar(50) not null,
	address varchar(50) not null,
	create_date timestamp,
	up_time timestamp default current_timestamp
	);

create table project.dim_cards(
	card varchar(50) primary key,
	account varchar(50) not null,
	create_date timestamp,
	up_time timestamp default current_timestamp
	);

create table project.dim_accounts(
	account varchar(50) primary key,
	account_valid_to date not null,
	client varchar(50) not null,
	create_date timestamp,
	up_time timestamp default current_timestamp
	);

create table project.dim_clients(
	client varchar(50) primary key,
	last_name varchar(50) not null,
	first_name varchar(50) not null,
	patrinymic varchar(50) not null,
	date_of_birth date not null,
	passport varchar(50) not null,
	passport_valid_to date not null,
	phone varchar(50) not null,
	create_date timestamp,
	up_time timestamp default current_timestamp
	);
	
	select trans_id,date,card,oper_type,amount,oper_result ,terminal from stg_transactions;

