	select client,last_name,first_name,patrinymic,date_of_birth,passport,passport_valid_to,phone from stg_load2;


--вставка обновленных данных

	select trans_id,date,card,oper_type,amount,oper_result ,terminal from stg_transactions
	where stg_transactions.trans_id not in (select trans_id from project.dim_transactions);

	select distinct on (terminal) terminal, terminal_type, terminal_city, address, create_date from stg_terminals
	where stg_terminals.terminal not in (select terminal from project.dim_terminals);

	select distinct on (card) card, account, create_date from stg_cards 
	where stg_cards.card not in (select card from project.dim_cards);

	select distinct on (account) account, account_valid_to, client, create_date from stg_accounts
	where stg_accounts.account not in (select account from project.dim_accounts);

	select distinct on (client) client, last_name, first_name, patrinymic, date_of_birth, passport, passport_valid_to, phone, create_date from stg_clients
	where stg_clients.client not in (select client from project.dim_clients);


	